import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";

const UploadPage = ({ secret }) => {
    const [title, setTitle] = useState("");
    const [description, setDescription] = useState("");
    const [image, setImage] = useState(null);
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState(null);
    const nav = useNavigate();

    // Handle the image change (file selection)
    const handleImageChange = (e) => {
        setImage(e.target.files[0]);
    };

    const handleSubmit = (e) => {
        e.preventDefault(); // Prevent the default form submission behavior

        // Validate the form data before submitting
        if (!image) {
            setError("Please upload an image.");
            return;
        }
        if (!title || !description) {
            setError("Title and Description are required.");
            return;
        }

        // Create FormData to send the request
        const postData = new FormData();
        postData.append("image", image); // Attach the image file
        postData.append("description", description); // Attach description
        postData.append("title", title); // Attach title
        postData.append("secretKey", secret); // Attach secretKey

        setLoading(true); // Set loading state to true while uploading

        // Send the request using fetch API
        fetch("http://167.99.138.67:1111/createpost", {
            method: "POST",
            body: postData, // Send FormData
        })
            .then((res) => res.json())
            .then((response) => {
                setLoading(false);
                if (response.success) {
                    setError(null);
                    nav("/gallery"); // Redirect to gallery or another page on success
                } else {
                    setError(response.message || "An error occurred while uploading.");
                }
            })
            .catch((err) => {
                setLoading(false);
                setError("An unexpected error occurred.");
            });
    };

    // Ensure that the Enter key does not submit the form prematurely
    const handleKeyDown = (e) => {
        if (e.key === "Enter") {
            e.preventDefault(); // Prevent the Enter key from submitting the form
        }
    };

    return (
        <div>
            <div className="toolbar-container">
                <Link to="/gallery" className="text-white">
                    HOME
                </Link>
                <Link to="/profile" className="text-white">
                    Users
                </Link>
            </div>
            <div style={styles.container}>
                <div style={styles.card}>
                    <h2>Create Post</h2>
                    <form onSubmit={handleSubmit} onKeyDown={handleKeyDown}>
                        <div className="d-flex row" style={styles.inputGroup}>
                            <label htmlFor="title">Title</label>
                            <input
                                type="text"
                                id="title"
                                value={title}
                                onChange={(e) => setTitle(e.target.value)}
                                required
                            />
                        </div>
                        <div style={styles.inputGroup}>
                            <label htmlFor="description">Description</label>
                            <textarea
                                id="description"
                                value={description}
                                onChange={(e) => setDescription(e.target.value)}
                                required
                            />
                        </div>
                        <div style={styles.inputGroup}>
                            <label htmlFor="image">Upload Image</label>
                            <input
                                type="file"
                                id="image"
                                accept="image/*"
                                onChange={handleImageChange}
                                required
                            />
                        </div>

                        {/* Error Message */}
                        {error && <div style={styles.error}>{error}</div>}

                        <button type="submit" disabled={loading} style={styles.button}>
                            {loading ? "Creating Post..." : "Create Post"}
                        </button>
                    </form>
                </div>
            </div>
        </div>
    );
};

const styles = {
    container: {
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        height: "auto",
        textAlign: "center",
    },
    card: {
        background: "#fff",
        padding: "30px",
        borderRadius: "8px",
        boxShadow: "0 4px 8px rgba(0, 0, 0, 0.1)",
        width: "300px",
        textAlign: "center",
    },
    inputGroup: {
        marginBottom: "15px",
        textAlign: "center",
    },
    input: {
        width: "100%",
        padding: "8px",
        borderRadius: "4px",
        border: "1px solid #ccc",
    },
    button: {
        width: "100%",
        padding: "10px",
        backgroundColor: "#007bff",
        color: "#fff",
        border: "none",
        borderRadius: "4px",
        cursor: "pointer",
    },
    error: {
        marginTop: "10px",
        fontSize: "14px",
        color: "red",
    },
};

export default UploadPage;
